import React, { Suspense, useState, useEffect } from 'react';
import { Canvas } from '@react-three/fiber';
import { 
  OrbitControls, 
  useGLTF, 
  Environment, 
  PresentationControls,
  Html,
  useProgress
} from '@react-three/drei';

function Loader() {
  const { progress } = useProgress();
  return <Html center>{progress.toFixed(0)} % carregado</Html>;
}

function Model({ modelPath, scale = 1 }) {
  const { scene } = useGLTF(modelPath);

  useEffect(() => {
    scene.traverse((child) => {
      if (child.isMesh) {
        child.castShadow = true;
        child.receiveShadow = true;
      }
    });
  }, [scene]);

  return (
    <primitive 
      object={scene} 
      scale={[scale, scale, scale]}
      position={[0, -1, 0]}
    />
  );
}

const models = [
  {
    name: "Basic Geodome",
    path: "/models/basic-geodome.glb",
    description: "Our basic geodome model, perfect for visualizing the core structure",
    scale: 0.8
  },
  {
    name: "Large 15m Geodome",
    path: "/models/large-geodome-15m.glb",
    description: "Spacious 15-meter diameter geodome, ideal for larger spaces",
    scale: 0.6
  },
  {
    name: "Woodframe 15m",
    path: "/models/woodframe-geodome-15m.glb",
    description: "15-meter geodome with detailed wooden frame construction",
    scale: 0.6
  },
  {
    name: "Roof House",
    path: "/models/roof-house.glb",
    description: "Geodome with integrated roof design",
    scale: 0.7
  }
];

function ARViewer() {
  const [currentModel, setCurrentModel] = useState(0);
  const [isAR, setIsAR] = useState(false);

  const checkARSupport = () => {
    return 'xr' in navigator;
  };

  useEffect(() => {
    setIsAR(checkARSupport());
  }, []);

  return (
    <section className="min-h-screen bg-gray-100 py-20" id="ar-experience">
      <div className="container mx-auto px-4">
        <div className="text-center mb-12">
          <h2 className="text-4xl font-bold mb-4">
            Visualize seu Geodome
          </h2>
          <p className="text-xl text-gray-600 mb-8">
            Explore nossos modelos em 3D e visualize em Realidade Aumentada
          </p>

          <div className="flex flex-wrap justify-center gap-4 mb-8">
            {models.map((model, index) => (
              <button
                key={model.name}
                onClick={() => setCurrentModel(index)}
                className={`px-6 py-3 rounded-lg transition-colors ${
                  currentModel === index
                    ? 'bg-blue-600 text-white'
                    : 'bg-white text-gray-800 hover:bg-gray-100'
                }`}
              >
                {model.name}
              </button>
            ))}
          </div>
        </div>

        <div className="bg-white rounded-xl shadow-xl overflow-hidden">
          <div className="h-[600px] relative">
            <Canvas
              camera={{ position: [5, 2, 5], fov: 50 }}
              shadows
              dpr={[1, 2]}
            >
              <color attach="background" args={['#f8f9fa']} />
              <fog attach="fog" args={['#f8f9fa', 8, 35]} />

              <Suspense fallback={<Loader />}>
                <PresentationControls
                  global
                  zoom={0.8}
                  rotation={[0, -Math.PI / 4, 0]}
                  polar={[0, Math.PI / 4]}
                  azimuth={[-Math.PI / 4, Math.PI / 4]}
                >
                  <Model 
                    modelPath={models[currentModel].path}
                    scale={models[currentModel].scale}
                  />
                </PresentationControls>
                <Environment preset="sunset" />
              </Suspense>

              <OrbitControls 
                makeDefault 
                minPolarAngle={0} 
                maxPolarAngle={Math.PI / 2} 
              />
            </Canvas>

            {isAR && (
              <button
                onClick={() => {
                  // Handle AR view
                  console.log('Launching AR experience');
                }}
                className="absolute bottom-4 right-4 bg-blue-600 text-white px-6 py-3 rounded-lg hover:bg-blue-700 transition-colors"
              >
                Ver em AR
              </button>
            )}
          </div>

          <div className="p-6 border-t border-gray-200">
            <h3 className="text-xl font-bold mb-2">
              {models[currentModel].name}
            </h3>
            <p className="text-gray-600">
              {models[currentModel].description}
            </p>
          </div>
        </div>

        <div className="mt-8 text-center">
          <p className="text-gray-600 mb-4">
            Dica: Use o mouse para girar o modelo. Scroll para zoom.
          </p>
          {!isAR && (
            <p className="text-yellow-600">
              Seu dispositivo não suporta visualização em Realidade Aumentada.
            </p>
          )}
        </div>
      </div>
    </section>
  );
}

export default ARViewer;
